## titlte




Tourism plays an important contribution to a country’s economy as travelers thrive to explore other cultures and have new experiences. To aid travelers in their decisions to travel abroad, the State Department has categorized each country by either a Level 1 (exercise normal caution), Level 2 (exercise increased caution), Level 3 (reconsider travel) or Level 4 (do not travel) (Travel Advisories).
This project, “The Anatomy of a Level 4 Travel Advisory: Safety, Economy, and Tourism” seeks  not only to understand all of the levels, but more specifically investigate the factors potentially leading to a country being categorized as a Level 4. The datasets used in this project provide information related to travel advisories, U.S. citizen deaths abroad, tourism trends, global safety indexes, and economic data.  In doing so, we will not only understand why those countries are deemed as highly unsafe but more importantly we will understand how those warnings affect a country’s economy.



